import React from 'react'
import { Form, Input, D } from 'semantic-ui-react'

export default class Homepage extends React.Component {

    render() {

        return (
            <Form>
            <Form.Field inline>
              <label>How Many People Are Eating?</label>
              <Input placeholder='First name' />
            </Form.Field>
          </Form>

        )
    }

}
